import classes from './MealItemForm.module.css';
import Input from '../../UI/Input';

const MealTimeForm = (props) => {
    return (
        <form className={classes.form}>
            <Input label="Amount" input={{
                id: 'amount',
                type: 'number',
                min: '1',
                max: '5',
                defaultValue: '1'
            }} />
            <button>+ Add</button>
        </form>
    )
}

export default MealTimeForm;
